import React, { Component } from 'react';


class FireTypeList extends Component {
	// showProps() {
	// 	console.log(this.props);
	// }
	render() {
		let firePokemon = this.props.pokeData.map(function (poke, index) {
			return <li>{ poke.name }</li>
		})

		return (
			<div>
				<h3>Fire Type</h3>
	      <ul className='fire'>
	        { firePokemon }
	      </ul>
	      <hr />
      </div>
		)
	}
}




export default FireTypeList;
